import React from 'react'
import Nav from 'react-bootstrap/Nav'
import Navbar from 'react-bootstrap/Navbar'
import Col from "react-bootstrap/Col";

function Header() {
	return (
		<div>
			<Navbar bg="light" variant="orange" width="30">
				<Navbar.Brand href="/">
					<i className="fas fa-paw" />
				PandaBoard
			</Navbar.Brand>
				<form style={{
					backgroundColor: 'Red',
					width: 240,
				}}><Col><h3>{"Vote Count " + 20}</h3></Col></form>
			</Navbar>
		</div >
	)
}

export default Header;
